css:
.nuclide-ui-fb-employee-datatip-container {
  display: flex;
  flex-direction: column;
  padding: 5px;
}
.nuclide-ui-fb-employee-datatip-link {
  cursor: pointer;
}
.nuclide-ui-fb-employee-datatip-link:hover {
  color: #d7dae0;
}
.nuclide-ui-fb-employee-datatip-Card {
  font-family: sans-serif;
}
.nuclide-ui-fb-employee-datatip-HeaderContent {
  display: flex;
}
.nuclide-ui-fb-employee-datatip-ProfilePhoto {
  border: 2px solid white;
  height: 58px;
  margin-right: 10px;
  width: 58px;
}
.nuclide-ui-fb-employee-datatip-HeaderText {
  flex-grow: 1;
}
.nuclide-ui-fb-employee-datatip-Location {
  align-items: center;
  display: flex;
  flex-grow: 1;
}
.nuclide-ui-fb-employee-datatip-fullname {
  color: #d7dae0;
  font-weight: bold;
}
.nuclide-ui-fb-employee-datatip-unixname {
  font-weight: bold;
}
.nuclide-ui-fb-employee-datatip-PositionText {
  line-height: 1.2em;
  margin-top: 4px;
  max-width: 16em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.nuclide-ui-fb-employee-datatip-ContactRow {
  display: flex;
}
.nuclide-ui-fb-employee-datatip-LocationLink {
  padding: 0.5em 1em;
  text-align: center;
}
.nuclide-ui-fb-employee-datatip-location-icon {
  padding-right: 0.25em;
}
.nuclide-ui-fb-employee-datatip-ContactButton {
  flex: 1 1 auto;
  padding: 8px;
  text-align: center;
  text-decoration: none;
}
